import React from 'react';
import Card from '../components/Card';
import CardBlock from '../components/CardBlock';
import styled from 'styled-components';

const MainPage = () => {
  return (
    <>
      <h3>MY DICTIONNARY</h3>
      <Card>
        <CardBlock id='1' title='단어' content={'word'} color='black' />
        <CardBlock id='2' title='설명' content={'desc'} color='black' />
        <CardBlock id='3' title='예시' content={'example'} color='skyblue' />
      </Card>

      <Button>+</Button>
    </>
  );
};
const Button = styled.button`
  width: 5rem;
  height: 5rem;

  background-color: rgb(97, 0, 255);
  color: white;
  font-weight: bold;
  font-size: 4.5rem;
  border-radius: 100%;

  cursor: pointer;

  border: none;
  position: sticky;

  bottom: 0rem;
  left: 15rem;
`;

export default MainPage;
